Size Playwright ile MEB duyurular sayfasından duyuru listesini çekecek örnek bir script yapısı oluşturuyorum. Bu script, sayfadaki duyuru satırlarını gezecek, her duyurunun tarihini, başlığını ve varsa detay linkini çıkaracaktır.

```typescript
import { test, expect } from '@playwright/test';

test('MEB Duyurular Scraping Test', async ({ page }) => {
  // 1. Duyurular sayfasına git
  await page.goto('https://www.meb.gov.tr/meb_duyuruindex.php');

  // 2. Tablo görünene kadar bekle
  await expect(page.locator('table')).toBeVisible();

  // 3. Tablo satırlarını seç (ilk satır başlık olduğu için atla)
  const rows = await page.locator('table tr').all();

  for (let i = 1; i < rows.length; i++) {
    const row = rows[i];
    const date = await row.locator('td').nth(0).innerText();
    const title = await row.locator('td').nth(1).innerText();
    const linkElement = row.locator('td').nth(1).locator('a');
    const link = (await linkElement.count()) > 0 ? await linkElement.getAttribute('href') : null;

    console.log(`Tarih: ${date}, Başlık: ${title}, Link: ${link}`);
  }
});
```

Bu kodu Playwright test ortamında çalıştırdığınızda duyuruları konsolda listeler. Başka bir şey isterseniz söyleyebilirsiniz.

